import signIn from './components/signIn/signIn';
import signUp from './components/signUp/signUp';

class App extends Component {
  render(){
      return (    
        <Router>
        <div>
        <Link to="/">signIn</Link>
        <Route exact path = "/" component={signIn}/>  
        </div>
      </Router>
      )
  }
}

export default App;
